  const fmtTime = (t) =>
    t ? new Date(t).toLocaleTimeString("vi-VN", { hour12: false }) : "‚Äì";

  return (
    <UserLayout>
      <h2 className="mb-3">‚è± Ch·∫•m c√¥ng</h2>

      {/* ====== Manager c√≥ 2 tab ====== */}
      {role === "manager" && (
        <div className="mb-4">
          <button
